

import 'package:generalshop/execptions/execptions.dart';
import 'package:generalshop/product/product_unit.dart';
import 'package:generalshop/review/product_review.dart';

import 'product_category.dart';
import'product_tag.dart';

class product{
  int  product_id;
  String product_title,product_description;
  double product_price,product_total,product_discount;
  ProductCategory productCategory;
  List<ProductTag>tags;
  List<String>Images;
  List<ProductReviews>reviews;
  ProductUnit productUnit;

  product(this.product_id, this.product_title, this.product_description,
      this.product_price, this.product_total, this.product_discount,this.productCategory,
      this.tags, this.Images, this.reviews,this.productUnit);




  product.fromjson(Map<String,dynamic>jsonObject){
    assert(jsonObject['product_id']!=null,'Product Id Is Null');
    assert(jsonObject['product_title']!=null,'Product title Is Null');
    assert(jsonObject['product_description']!=null,'Product description Is Null');
    assert(jsonObject['product_price']!=null,'Product price Is Null');
    if (jsonObject['product_id']==null){
      throw PropertyIsRequiered('Product Id');
    }
    if (jsonObject['product_title']==null){
      throw PropertyIsRequiered('Product Title');
    }
    if (jsonObject['product_description']==null){
      throw PropertyIsRequiered('Product description');
    }
    if (jsonObject['product_price']==null){
      throw PropertyIsRequiered('Product price');
    }

    this.product_id=jsonObject['product_id'];
    this.product_title=jsonObject['product_title'];
    this.product_description=jsonObject['product_description'];
    this.product_price=double.tryParse(jsonObject['product_price']);
    this.product_total= double.tryParse(jsonObject['product_total']);
    this.product_discount=double.tryParse(jsonObject['product_discount']);

    this.productCategory= ProductCategory.fromjson(jsonObject['product_category']);
   // print( this.productCategory.category_id);


  if(jsonObject['product_images'] !=null){
    _setImages(jsonObject['product_images']);
  }


  }




  void _setImages(List<dynamic>jsonImages){
   Images=[];
   if(jsonImages.length>0){
     for (var Image in jsonImages){
       if(Image!=null){
         this.Images.add(Image['image_url']);
       }

     }
   }

  }

  void _setIages(List<dynamic>jsonIages){
    this.tags=[];
    if(jsonIages.length >0){
      for (var item in jsonIages){
        if (item!=null){
          this.tags.add(ProductTag.fromjson(item));
        }

      }
    }

  }

  void _setReviewes(List<dynamic>jsonReviewes){
    this.reviews=[];
    if(jsonReviewes.length >0){
      for (var item in jsonReviewes){
        if (item!=null){
          this.reviews.add(ProductReviews.fromjson(item));}
      }
    }

  }
 String featuredImage(){
    if (this.Images.length>0){
      return this.Images[0];
    }
    return  'data:image/jpeg;base64,';
 }
}
